from pyspark.sql import functions as f
def clean_column_row(value):
    if type(value)!=str:  
        return value
    value = value.strip()
    value = value.lower()
    if len(value)==0:
        return None
    return value

clean_column = f.udf(clean_column_row,'string')

def depure_string(col):
    if type(col)!=str:
        return col
    return f.regexp_replace(f.regexp_replace(f.regexp_replace(col,"\?","o"),"[^a-z]", " "),"\\s+", " ")
